import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './index.css';
import ExerciseList from './components/ExerciseList';

ReactDOM.render(
    <React.StrictMode>
      <Router>
        <ExerciseList />
      </Router>
    </React.StrictMode>,
  document.getElementById('root')
);
